import { makeStyles } from '@material-ui/core'

export default makeStyles((theme) => ({
    center: {
        // display: 'flex',
        flexDirection: 'column',
        alignItems: 'center',
        justifyContent: 'center',
    },
    title: {
        margin: '2rem',
        color: '#F7F7FF',
    },
    grid: {
        flexGrow: 5,
        justifyContent: 'center',
        alignItems: 'center',
        marginBottom: 70,
    },
    buttonTray: {
        // display: 'flex',
        // flexDirections: 'row',
        // justifyContent: 'center',
        // alignItems: 'center',
        margin: 5,
        right: 20,
        bottom: 20,
        position: 'fixed',
        zIndex: 999,
    },
    employeeFormContainer: {
        width: 'auto',
        height: 'auto',
        margin:'0 auto',
        position: 'absolute',
        left: '50%',
        top: 200,
        marginTop: 80,
        paddingBottom: 90,
    },
    button: {
        margin:10,
    },
}))
